import Link from 'next/link';

type ListingViewProps = {
  title: string,
  id: string,
  type: 'job' | 'article'
  classNames?: string;
}

export const ListingView = ({ title, id, type, classNames }: ListingViewProps) => (
  <article className={classNames}>
    <Link href={`/${type}s/[id]`} as={`/${type}s/${id}`}>
      <a>{title}</a>
    </Link>
  </article>
)

export default ListingView
